package com.amandris.clients.web.view;import org.apache.struts.action.ActionForm;public class ContactMessageView extends ActionForm{	private String 	id;	private String 	contactId;	private String 	text;	private String  date;	private String  sentFromBuyer;	private String  isNew;		private static final long serialVersionUID = 1522471159622776075L;		public ContactMessageView()	{		id				= "";		contactId		= "";		text			= "";		date			= "";		sentFromBuyer	= "";		isNew			= "";	}	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getText() {		return text;	}	public void setText(String text) {		this.text = text;	}	public String getContactId() {		return contactId;	}	public void setContactId(String contactId) {		this.contactId = contactId;	}	public String getDate() {		return date;	}	public void setDate(String date) {		this.date = date;	}	public String getIsNew() {		return isNew;	}	public void setIsNew(String isNew) {		this.isNew = isNew;	}	public String getSentFromBuyer() {		return sentFromBuyer;	}	public void setSentFromBuyer(String sentFromBuyer) {		this.sentFromBuyer = sentFromBuyer;	}			}